import React from 'react';
import axios from 'axios';

function MemoryLog({ memory, setMemory }) {
  const handleRefresh = async () => {
    const res = await axios.get('http://localhost:8000/memory');
    setMemory(res.data);
  };

  if (!memory) return null;
  const { input_metadata, extracted_fields } = memory;

  return (
    <div style={{ background: '#fffbe6', padding: 16, borderRadius: 8 }}>
      <h3>Memory Log</h3>
      <button onClick={handleRefresh} style={{ marginBottom: 8 }}>Refresh</button>
      <div style={{ marginBottom: 12 }}>
        <strong>Input Metadata</strong>
        <table style={{ width: '100%', fontSize: 12 }}>
          <thead>
            <tr>
              <th>ID</th><th>Source</th><th>Type</th><th>Timestamp</th><th>Intent</th><th>Agent</th>
            </tr>
          </thead>
          <tbody>
            {input_metadata && input_metadata.map(row => (
              <tr key={row[0]}>
                <td>{row[0]}</td><td>{row[1]}</td><td>{row[2]}</td><td>{row[3]}</td><td>{row[4]}</td><td>{row[5]}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
      <div>
        <strong>Extracted Fields</strong>
        <table style={{ width: '100%', fontSize: 12 }}>
          <thead>
            <tr>
              <th>ID</th><th>Agent</th><th>Fields</th>
            </tr>
          </thead>
          <tbody>
            {extracted_fields && extracted_fields.map(row => (
              <tr key={row[0]}>
                <td>{row[0]}</td><td>{row[1]}</td><td><pre style={{ whiteSpace: 'pre-wrap', wordBreak: 'break-all' }}>{row[2]}</pre></td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default MemoryLog;
